function Login() {
  return (
  <>
    <div class="mb-3">
        <label for="exampleFormControlInput1" class="form-label">Email address</label>
        <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="username"/>
    </div>
  </>
  );
}

export default Login;
